const ordStt = [
    "Denied",
    "Done",
    "Cancled"];

    const createOrder = () => {
        let query = "INSERT INTO orders (Id, UserID, CouponID, `Status`, TotalValue, Delivery, CreateAt, " +
        "UpdateAt, DeleteAt, AddressID, PaymentMethod) VALUES \n";
        users.forEach((item, index) => {
            const availableCP = data.filter((cp) => item.id === cp.user);
            const adr = address.filter((adr) => adr.user === item.id)

            while(availableCP.length != 0) {
                const id = createID("ORD");
                let createAt = formatDate(conditionDate(item.createAt));
                const cp = availableCP[Math.floor(Math.random() * availableCP.length)];
                const status = ordStt[Math.floor(Math.random() * 3)];
                const deliveryAt =  formatDate(conditionDate4(createAt));
                const deleteAt = status === 'Done' ? null : formatDate(conditionDate3(createAt));
                query += `('${id}', '${item.id}', '${cp.cpID}', '${status}', '${Math.floor(Math.random() * 20)}', '${Math.floor(Math.random() * 30)}', '${createAt}', '${status === 'Done' ? deliveryAt: deleteAt}', ${status === 'Done' ? `'${deliveryAt}'` : 'NULL'}, '${adr[Math.floor(Math.random() * adr.length)].id}', '${Math.floor(Math.random() * 7) < 6 ? 'Upfront': 'Later'}'),\n`;
                availableCP.splice(availableCP.indexOf(cp), 1);
            }

        })
        fs.writeFile('insertOrder.sql', query.slice(0,-2)+';', (err) => {
            if (err) throw err;
            console.log('The file has been saved!');
        });
    }